import React from 'react';

const BookContainer = (props) => {
    // a            author: "",
    //  a           book_image: "",
    //  a           description: "",
    //  a           grRating: "",
    // a            numPages: "",
    //   x          primary_isbn10: "",
    //             reviews: "",
    //  a           title: "",
    //             url: ""
    return (
        <div>
            Container<br/>
            <img src={props.book.book_image}/>
            <div>title: {props.book.title}</div>
            <div>Author: {props.book.author}</div>
            <div>Pages: {props.book.numPages}</div>
            <div>Description: {props.book.description}</div>
            <div>Rating: {props.book.grRating}</div>
            <div>goodreads Url: {props.book.url}</div>
            <div dangerouslySetInnerHTML={{__html: props.book.reviews}}/>
        </div>
    );
};

export default BookContainer;
